import React from 'react';
import { Container, Row, Col, Card, ListGroup, Button } from 'react-bootstrap';
import './AboutUs.css'; 

const AboutUs = () => {
  return (
    <div style={{ fontFamily: 'Poppins, sans-serif' }}>
      {/* Hero Section */}
      <section className="hero-section">
        <div className="hero-content">
          <h1>About HDSI Foundation</h1>
          <p>
            Learn more about the mission, vision, and values that drive us to create a positive
            impact in the world.
          </p>
          <Button variant="primary" href="#mission-section">Explore Our Work</Button>
        </div>
      </section>
    
      <section id="mission-section" className="about-section">
        <Container>
          <Row>
            <Col md={12}>
              <Card>
                <Card.Body>
                  <Card.Title>Who We Are</Card.Title>
                  <Card.Text>
                    The HDSI Foundation is a non-profit organization committed to promoting education,
                    innovation, and community welfare.
                  </Card.Text>
                </Card.Body>
              </Card>
            </Col>
          </Row>
          {/* Other content */}
        </Container>
      </section>
    </div>
  );
};

export default AboutUs;
